<br><p style="text-align: justify;"><span style="color: #ffffff;">Nasza Firma juz od ponad 12 lat zajmuje sie wynajem wysokiej klasy specjalistycznych maszyn budowlanych. Jestesmy znani na lokalnym rynku, a nasze uslugi moga pochwalic sie wysokiej klasy jakoscia. Wykonujemy uslugi koparko-ladowarka, minikoparka, walcem jezdnym, koparka kolowa i gasienicowa. Ponadto zapewniamy dostep do podnosnikow koszowych oraz sprzetu HDS.</span></p></div>
